import "./App.css";
import React, { useRef, useState, useEffect } from "react";
import axios from "./axios";
import useRefreshToken from "./hooks/useRefreshToken";
import useAxiosPrivate from "./hooks/useAxiosPrivate";
import ImageUploading from 'react-images-uploading';
const DOG_URL = "/dogs";
const DOG_IMG_URL = "http://localhost:3000/img/${item.img}.jpg";


function Browsedogs() {
  const axiosPrivate = useAxiosPrivate();

  const userRef = useRef();
  const errRef = useRef();
  const [errMsg, setErrMsg] = useState("");
  const [data, getData] = useState([]);
  const URL = "http://localhost:3000/dogs";
  const [id, setId] = useState("");
  const [name, setName] = useState("");
  const [breed, setBreed] = useState("");
  const [location, setLocation] = useState("");
  const [img, setImg] = useState([]);
  const [name2, setName2] = useState("");
  const [breed2, setBreed2] = useState("");
  const [location2, setLocation2] = useState("");
  const [img2, setImg2] = useState([]);
  const [images, setImages] = React.useState([]);
  const maxNumber = 1;
  const [success, setSuccess] = useState(false);
  const [file, setFile] = useState('');
  const [filename, setFilename] = useState('Choose File');
  const [uploadedFile, setUploadedFile] = useState({});

  const onChange = (imageList, addUpdateIndex) => {
    console.log(imageList, addUpdateIndex);


  };


   /* const onImageUploadToServer = () => { 
    axios({
        method:'post',
        url:'http://localhost:3000/img',
        headers: {
            'Content-Type': images
          }

    });
    setImages();
    alert(ImageUploading.dataURLKey);
  }
    */  


  const getalldogs = useRefreshToken();

  useEffect(() => {
    userRef.current.focus();
  }, []);

  useEffect(() => {
    setErrMsg("");
  }, [id, name, breed, location]);



  const handleSubmit = async (e) => {
    e.preventDefault();
  };



  const fetchData = () => {
    fetch(URL)
      .then((res) => res.json())

      .then((response) => {
        console.log(response);
        getData(response);
      });
  };

  const Searchdog = () => {
    fetch(URL)
      .then((res) => res.json())

      .then((response) => {
        console.log(response);
        getData(response);
      });
  };

  const getdogbyID = async (e) => {


    try {
      const response = await axios.get(
        DOG_URL+"/dogid/"+id

      );

      setId("");
     const res = (response) => {
        console.log(response);
        getData(response);
      };

    } catch (err) {
      if (!err?.response) {
        setErrMsg("No Server Response");
      }
      errRef.current.focus();
    }
  };



  return (
    <>

      {success ? (
        <section>
          <br></br>
          <h1>Dog successfully modified!</h1>
        </section>
      ) : (
        <section>







          <div className="loginstuffv5">
            <p
              ref={errRef}
              className={errMsg ? "errmsg" : "offscreen"}
              aria-live="assertive"
            >
              {errMsg}
            </p>
            <div className="textthingymod">
              <h1>Dog browser</h1>
            </div>

            <div className="textthingyguidefind">
              <h3>Search: Partial query for fields</h3>
              <br></br>
              <h3>Filter: Must contain items for fields</h3>
            </div>

            <div className="scrolldownrem">
              <h1>Scroll down to get a list of current dogs!</h1>
            </div>

            <form onSubmit={handleSubmit}>
            <div className="blacktext0">
                <label htmlFor="id">ID:</label>
                <input
                  type="text"
                  id="id"
                  ref={userRef}
                  autoComplete="off"
                  onChange={(e) => setId(e.target.value)}
                  value={id}

                  aria-describedby="uidnote"
                />
                <div className="minibuttonset">
                <button onClick={() => getdogbyID()}>Find dog by ID</button>
              </div>
              </div>
              <div className="blacktext1">
                <label htmlFor="name">Name:</label>
                <input
                  type="text"
                  id="name"
                  ref={userRef}
                  autoComplete="off"
                  onChange={(e) => setName(e.target.value)}
                  value={name}

                  aria-describedby="uidnote"
                />
              </div>
              <div className="blacktext2">
                <label htmlFor="breed">Breed:</label>
                <input
                  type="text"
                  id="breed"
                  onChange={(e) => setBreed(e.target.value)}
                  value={breed}

                />
              </div>
              <div className="blacktext5">
                <label htmlFor="location">Location:</label>
                <input
                  type="text"
                  id="location"
                  autoComplete="off"
                  onChange={(e) => setLocation(e.target.value)}
                  value={location}

                  aria-describedby="uidnote"
                />
              </div>


              <div className="findalldogs">
                <button onClick={() => fetchData()}>All dogs</button>
              </div>

              <div className="searchdogs">
                <button onClick={() => Searchdog()}>Search</button>
              </div>




            </form>
            <p>
              <span className="line"></span>
            </p>
          </div>

          <div className="adddogimg">






<div className="admindogsdisplay">
<tbody>
        <tr>
          <th>Dog ID</th>
          <th>Name</th>
          <th>Breed</th>
          <th>Location</th>
          <th>img</th>
        </tr>
        {data.map((item, i) => (
          <tr key={i}>
            <td>{item._id}</td>
            <td>{item.name}</td>
            <td>{item.breed}</td>
            <td>{item.location}</td>
            <div className='imagesinsidetable'>
            <td><img class="img3" src={`http://localhost:3000/img/${item.img}.jpg`}></img></td>
            </div>
          </tr>
        ))}
      </tbody>

      </div>
          </div>
        </section>

      )}
    </>
  );
}


export default Browsedogs;
